 They're always up to something kind of stupid. Take Cuckold Charlie. He loves sports. The only thing he loves more than sports is gambling on sports. He calls most of his bets &quot;locks&quot; and &quot;easy money&quot;. Then why does he owe the bookie 10 Large? Trust me, The Bookie is tired of chasing Cuckold Charlie around for his money. After a sound beating, it's on to Cuckold Charlie's house, where, Charlie claims, is all the money he owes The Bookie. Once there, however, there's no money. There is his girlfriend, Maddy. Maddy's shocked to see what's going on. She thought Charlie was all done betting. Charlie's such a degenerate gambler, he's going to be OK with Maddy's mouth, pussy, and ass acting as &quot;the vig&quot; until Charlie comes up with some hard cash. Does it really surprise you, too, that Maddy's got some skeletons in her closet? They're big, black skeletons!
